What you will learn
Welcome to the Quick Start to Modeling in 3ds Max, a series of specially constructed courses meant to be followed in sequence and which include valuable exercises to reinforce learned concepts.

The lesson format for these Quick Starts will be similar to other Digital Tutors introductory training. We'll go through 3ds Max Modeling in a very methodical, step-by-step, way, making sure to cover the tools and techniques that are most important in enabling you to get up and running quickly. Each volume of a Quick Start will build upon the previous volume, enabling us to progressively build up a complex project into a finished state.

While following along with these lessons and building a project together will provide you with valuable knowledge, the real power comes from being able to take the techniques you've learned and apply them in a different way to your own work. With this in mind, you'll be presented with an assignment immediately following each volume. These assignments will challenge you to take the skills that you've learned in a particular volume and apply them to a different asset.
